import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";




import  Navbar  from './Component/Navbar';
import About from './Component/About';
import Project from './Component/Project';
import Footer from './Component/Footer';


function App() {
  return (
    <>
    <Navbar/>
    <Card className="text-center">

  <Card.Body className='fw-lighter'>

    <Card.Title> Mrwa  Alsubhi..</Card.Title>
    <Card.Text>
    <p>Photographer of Saudi Arabia - Madina </p>
        <p>I practice photography since 2015 .. </p>
        <p> I have given many courses in the field of photography, both in person and remotely</p>



    </Card.Text>
  </Card.Body>

</Card>
    <Project/>
    <Footer/>


    </>


  );
}

export default App;
